La frontière entre le Laos et la Thaïlande est formée par le Mékong sur la plus grande partie de sa longueur, la Thaïlande se trouvant sur la rive droite du fleuve (à l'ouest) et le Laos sur sa rive gauche (orientale), à l'exception de deux provinces laotiennes sur la rive droite : au nord-ouest, la province de Sayaboury, et dans l'extrême-sud, une partie de la province de Champasak. Au niveau de la province de Sayaboury, la frontière suit la ligne de partage des eaux entre le bassin de la Nan (affluent de la Chao Phraya) et celui du Mékong. Au niveau de la province de Champasak, elle suit la limite sud du bassin de la Mun (affluent du Mékong) jusqu'à la frontière cambodgienne. Toutes les îles du Mékong font partie du territoire laotien. Il existe en décembre 2013 quatre ponts transfrontaliers : 
* le Pont de l'amitié lao-thaïlandaise, entre Nong Khai en Thaïlande et Vientiane au Laos depuis 1994 ; 
* le Deuxième pont de l'amitié lao-thaïlandaise, entre Mukdahan en Thaïlande et Savannakhet au Laos depuis 2006 ; 
* le Troisième pont de l'amitié lao-thaïlandaise, entre Nakhon Phanom et Thakhek, depuis novembre 2011. 
* le pont de Houei Sai, inauguré le 11 décembre 2013.
